import React from 'react';
import "./sidebar.css";

class Sidebar extends React.Component {
    render(){
        return(
            <div className="Sidebar">
                <a className="active" href='#home'>Home</a>
                <a href='#courses'>Courses</a>
                <a href='#seminars'>Seminars</a>
            </div>
        )
    }
}

export default Sidebar;
